@import './variables';
@import './global';

.header {
  width: 100%;
  height: 113px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  z-index: 10;

  @media screen and(max-width: 390px) {
    height: 90px;
  }

  .mobile__menu {
    display: none;

    @media screen and(max-width: 700px) {
      display: block;
      font-size: 1.25rem; //20px
      cursor: pointer;
    }
  }

  .mobile__close {
    font-size: 1.5rem; //20px
    cursor: pointer;
    display: none;
  }

  @media screen and(max-width: 1270px) and (min-width: 1024px) {
    padding: 2.5em;
  }

  @media screen and(max-width: 1023px) {
    padding: 0;
  }

  .nav__top {
    display: flex;

    @media screen and(max-width: 700px) {
      position: absolute;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      background-color: $lightCream;
      width: 100%;
      height: 0;
      top: 113px;
      left: 0;
      z-index: 2;
      transition: height 400ms ease-in-out;
    }

    @media screen and(max-width: 390px) {
      top: 90px;
    }

    a {
      font-family: $barlow;
      font-weight: 700;
      font-size: 0.75rem;
      line-height: 1;
      color: $gray;
      text-transform: uppercase;
      transition: color 200ms ease-in-out;

      &:not(:last-child) {
        margin-right: 33px;
      }

      &:hover {
        color: $darkGray;
      }

      @media screen and(max-width: 700px) {
        font-size: 0;
        font-family: $fraunces;
        line-height: 32px;
        text-transform: capitalize;
        color: $darkGray;
        visibility: hidden;
        transition-property: visibility, font-size;
        transition: 300ms ease-in-out;

        &:not(:last-child) {
          margin-right: 0;
          margin-bottom: 32px;
        }
      }
    }
  }
}

